description:
The Man Who Discovered Egypt

History Documentary hosted by Chris Naunton, published by BBC in 2012 - English narration


Information
------------------------------

Documentary about English Egyptologist, Flinders Petrie, the pioneer of systematic methodology in archaeology. Ancient Egypt was vandalised by tomb raiders and treasure hunters until one Victorian adventurer took them on. Most of us have never heard of him, but this maverick underook a scientific survey of the pyramids, discovered the oldest portraits in the world, unearthed Egypt's prehistoric roots - and in the process invented modern field archaeology, giving meaning to a whole civilisation.

